import React, { Component } from 'react'
import Book from "../Book/book";

class BookList extends Component {


    render() {

        console.log("Props", this.props.bookState)

        return (
            this.props.bookState.map((book) => (
            <Book
            key={book.id}
            id={book.id}
            title={book.items.volumeInfo.title}
            link={book.items.volumeInfo.previewLink}
            authors={book.items.volumeInfo.authors && book.volumeInfo.authors.length > 1 ? book.volumeInfo.authors.join(", ") : book.volumeInfo.authors}
            image={book.items.volumeInfo.imageLinks ? book.volumeInfo.imageLinks.thumbnail : "https://secocms.cpa.texas.gov/sca-dev-kilimanjaro/img/no_image_available.jpeg"}
            description={book.items.volumeInfo.description}
            saveGoogleBook={this.props.saveGoogleBook}
            />
        ))
        )

    }
}

export default BookList
